$(function () {
    if ($('#display_countdown').length) {
        const targetDay = new Date($('#display_countdown').data('countdown-date'));
        const formattedTargetDay = `${targetDay.getFullYear()}/${targetDay.getMonth()}/${targetDay.getDate()}`;
        const countdown = setInterval(function() {
            const now = new Date();
            const lastSeconds = (targetDay.getTime() - now.getTime()) / 1e3 - 9 * 3600;
            const countdownDay = Math.floor(lastSeconds / 86400);
            if (Math.floor(lastSeconds) <= 0 && formattedTargetDay === `${now.getFullYear()}/${now.getMonth()}/${now.getDate()}`) {
                clearInterval(countdown);
                $(".countdown__upper, .countdown__lower").addClass("hidden");
                $(".countdown__center").addClass("active");
                writingWeddingday();
            } else if (countdownDay >= 0) {
                $(".countdown__upper .date_text").html("COUNTDOWN");
                calcCountdownDate(countdownDay, lastSeconds);
            } else {
                clearInterval(countdown);
            }
        }, 1000);

        // 
        function calcCountdownDate(countdownDay, lastSeconds) {
            // 
            $('#countdown_day').html(countdownDay);
            singleOrPlural(countdownDay, "#date_unit", "DAY");

            // 
            const countdownHour = Math.floor(lastSeconds % 86400 / 3600);
            $('#countdown_hour').html(countdownHour);
            singleOrPlural(countdownHour, "#time_unit_hour", "HOUR");

            // 
            const countdownMinute = Math.floor(lastSeconds % 3600 / 60);
            $('#countdown_minute').html(countdownMinute);
            singleOrPlural(countdownMinute, "#time_unit_minute", "MINUTE");

            // 
            const countdownSecond = Math.floor(lastSeconds % 60);
            $('#countdown_second').html(countdownSecond);
            singleOrPlural(countdownSecond, "#time_unit_second", "SECOND");
        }

        // 
        function singleOrPlural(targetTime, id, timeUnit) {
            if (targetTime <= 1) {
                $(id).html(timeUnit);
            } else {
                $(id).html(timeUnit+'S');
            }
        }

        function writingWeddingday() {
            new Vivus('writing_weddingday', {start: 'inViewport', type: 'delayed', duration: 150}, function () {
                $('#writing_weddingday').addClass("painted");
            });
        }
    }
});


