/**
 * Vue mixin
 */
window._CommonMixin = {
    /**
     * 
     */
    methods: {
        /**
         * Formsubmit
         * @param form
         * @param callback object
         */
        $_submitForm: function (form, callback) {
            var _this = this;
            var url = form.getAttribute('action');

            var formData = new FormData(form);

            _this.errors = [];
            _this.$_loading();
            axios.post(url, formData)
                .then(function (response) {
                    if (response.data.status === 'OK') {
                        if (callback.success) {
                            // 
                            callback.success(response);
                        } else {
                            // 
                            location.href = response.data.href ? response.data.href : location.href;
                        }
                    } else {
                        if (response.data.errors) {
                            if (callback.error) {
                                // 
                                callback.error(response);
                            } else {
                                // 
                                response.data.errors.forEach(function (error) {
                                    _this.errors.push(error);
                                });
                            }
                        } else {
                            if (callback.fail) {
                                // 
                                callback.fail('');
                            } else {
                                // 
                                swalToast('', {icon: 'error'});
                            }
                        }
                    }
                })
                .catch(function (error) {
                    if (callback.error) {
                        // 
                        callback.error(error);
                        return;
                    }
                    swalToast('', {icon: 'error'});
                    if (error.response && error.response.data.errors) {
                        _this.errors = error.response.data.errors;
                    } else {
                        _this.errors.push(error.message);
                    }
                })
                .then(function () {
                    // 
                    _this.$_unloading();
                });
        },

        /**
         * 3numeral
         * @param value
         * @param format
         * @returns {*}
         */
        $_numberFormat: function(value, format) {
            if (value === null) {
                return null;
            }

            if (format === undefined) {
                return numeral(value).format('0,0.[0000]');
            }
            return numeral(value).format(format);
        },

        /**
         * 
         */
        $_loading: function () {
            if (!!document.body.querySelector('.loader_overlay')) {
                // 
                return;
            }
            document.body.classList.add('loader_opened');

            var overlay = document.createElement('div');
            overlay.classList.add('loader_overlay');
            var spinner = document.createElement('div');
            spinner.classList.add('spinner');
            var bounce1 = document.createElement('div');
            bounce1.classList.add('bounce1');
            var bounce2 = document.createElement('div');
            bounce2.classList.add('bounce2');
            var bounce3 = document.createElement('div');
            bounce3.classList.add('bounce3');

            spinner.appendChild(bounce1);
            spinner.appendChild(bounce2);
            spinner.appendChild(bounce3);
            overlay.appendChild(spinner);
            document.body.appendChild(overlay);
        },

        /**
         * 
         */
        $_unloading: function () {
            document.body.classList.remove('loader_opened');

            var loader = document.body.querySelector('.loader_overlay');
            if (!!loader) {
                loader.parentNode.removeChild(loader);
            }
        },
    }
};

